(function($) {

  $(".reveal").each(function() {
    var reveal = $(this);
    var revealEvent = reveal.attr("data-reveal-event");
    checkStatus(reveal, revealEvent);
  });

  function checkStatus(reveal, revealEvent) {
    var revealOffset = reveal.attr("data-reveal-offset");
    var revealUnits = reveal.attr("data-reveal-units");
    if (revealOffset != 0) {
      reveal.addClass("hidden");
      if (revealEvent == "") {
        var now = moment();
        var showTime = moment(now).add(revealOffset, revealUnits);
      } else {
        var showTime = moment(revealEvent).add(revealOffset, revealUnits);
      }
      $(function() {
        setInterval(oneSecondFunction, 1000);
      });
      function oneSecondFunction() {
        displaySection(reveal, showTime);
      }
    }
  }

  function displaySection(reveal, showTime) {
    var now = moment();
    if (moment(now).isAfter(showTime)) {
      reveal.removeClass("hidden");
      window.dispatchEvent(new Event("message:assessment:resize"));
    }
  }

})(jQuery);

