(function() {
  $(".event").each(function() {
    kajabiEvent($(this));
  });

  function kajabiEvent(event) {
    var $event = event;
    var $eventTime = $event.attr("data-event-time");
    offsetEvent($event, $eventTime);

    function offsetEvent(event, eventTime) {
      var $eventOffsetNumber = event.attr("data-offset-number");
      var $eventOffsetPeriod = event.attr("data-offset-period");
      var $eventTime = moment(eventTime).add($eventOffsetNumber, $eventOffsetPeriod);
      checkEventStatus(event, $eventTime);
    }

    function checkEventStatus(event, eventTime) {
      var $momentNow = moment();
      var $momentEvent = moment(eventTime);
      var diff = $momentNow.diff($momentEvent, 'seconds');
      formatDate(event, eventTime);
      if (diff < 0) beforeEvent(event, eventTime);
      else afterEvent(event, eventTime);
    }

    function beforeEvent(event, eventTime) {
      countdownTimer(event, eventTime);
    }

    function afterEvent(event, eventTime) {
      if (!Kajabi.theme.editor) {
        var $timer = event.find(".countdown");
        var $AfterAction = $timer.attr("data-end-action");
        var $AfterActionUse = $timer.attr("data-end-action-use");

        if ($AfterActionUse == "true" ) {
          if ($AfterAction == "#next-pipeline-step" && $AfterActionUse == "true" ) {
            window.location = Kajabi.nextPipelineStepUrl;
          } else {
            window.location.href = $AfterAction;
          }
        }
        if ($timer.attr("data-remove-section-on-complete") == "true") {
          var $eventCountdownSection = $event.find(".countdown").parents(".section").parent();
          $eventCountdownSection.remove();
        }
      }
    }

    function formatDate(event, eventTime) {
      var $eventDate = event.find(".event__date");
      var $eventDateFormat = $eventDate.attr("data-format");
      var $eventShowYear = $eventDate.attr("data-show-year");
      var $eventShowTime = $eventDate.attr("data-show-time");
      var $eventShowTimezone = $eventDate.attr("data-show-timezone");
      var tz = moment.tz.guess();
      if ($eventShowYear == "true" ) {
        var $eventYearFormat = ", YYYY"
      } else {
        var $eventYearFormat = ""
      }
      if ($eventShowTime == "true" ) {
        var $eventTimeFormat = " h:mm A"
      } else {
        var $eventTimeFormat = ""
      }
      if ($eventShowTimezone == "true" ) {
        var $eventTimezoneFormat = " zz";
      } else {
        var $eventTimezoneFormat = ""
      }
      var $eventFormatted = moment.tz(eventTime, tz).format($eventDateFormat+$eventYearFormat+$eventTimeFormat+$eventTimezoneFormat);
      $eventDate.text($eventFormatted);
    }

    function countdownTimer(event, eventTime) {
      var $timer = event.find(".countdown--standard");
      var $timerEndTime = eventTime;

      var timeEnd = moment($timerEndTime);

      $timer.countdown(timeEnd.toDate(), function(e) {
        if (e.elapsed) {
          checkEventStatus(event, eventTime);
        } else {
          $timer.find(".days").text(e.strftime('%D'));
          $timer.find(".hours").text(e.strftime('%H'));
          $timer.find(".minutes").text(e.strftime('%M'));
          $timer.find(".seconds").text(e.strftime('%S'));
        }
      });
    }
  }

  // Refreshes event js when section reloads
  $(window).on("section:reload", function() {
    kajabiEvent($(".event"));
  });
})(jQuery);
(function($) {

  if (Kajabi.theme.editor) return false;

  var $window = $(window);
  var $body = $("body");
  var $dropdown = $(".dropdown");
  var $trigger = $(".dropdown__trigger");
  var openedClass = "dropdown--open";

  $trigger.on("click", toggleMenu);
  $window.on("resize", closeAll);
  $body.on("click", closeAll);

  $dropdown.data("isOpen", false);

  function toggleMenu(event) {
    event.stopPropagation();
    var $thisTrigger = $(event.currentTarget);
    var $thisDropDown = $thisTrigger.parents(".dropdown");
    $dropdown.not($thisDropDown).removeClass(openedClass);
    $dropdown.not($thisDropDown).data("isOpen", false);
    if ($thisDropDown.data("isOpen") == false) openMenu($thisDropDown, $thisTrigger);
    else closeMenu($thisDropDown);
  }

  function openMenu(el, trigger) {
    el.data("isOpen", true);
    el.addClass(openedClass);
    var $menu = el.find(".dropdown__menu");
    if ($menu.hasClass("dropdown__menu--text-center")) {
      var menuX = (trigger.outerWidth() / 2) - ($menu.outerWidth() / 2);
      $menu.css("left", menuX);
    }
  }

  function closeMenu(el) {
    el.data("isOpen", false);
    el.removeClass(openedClass);
  }

  function closeAll() {
    $dropdown.removeClass(openedClass);
    $dropdown.data("isOpen", false);
  }

})(jQuery);

(function() {
  $( ".event-video" ).each(function() {
    kajabiEventVideo($(this));
  });

  function kajabiEventVideo(event) {
    var $event = event;
    var $eventTime = $event.attr("data-event-time");
    offsetEventVideo( $event, $eventTime );

    function offsetEventVideo(event, eventTime) {
      var $eventOffsetNumber = event.attr("data-offset-number");
      var $eventOffsetPeriod = event.attr("data-offset-period");
      var $eventTime = moment(eventTime).add($eventOffsetNumber, $eventOffsetPeriod);
      checkEventVideoStatus(event, $eventTime);
    }

    function checkEventVideoStatus( event, eventTime ) {
      var $momentNow = moment();
      var $momentEvent = moment(eventTime);
      var diff = $momentNow.diff($momentEvent, 'seconds');
  
      if ( diff < 0 ) {
        beforeEventVideo( event, eventTime );
      } else  {
        wistiaVideo( event, eventTime );

      }
    }

    function beforeEventVideo( event, eventTime ) {
      event.find(".event-video__item").removeClass("active");
      event.find(".event-video__item--before").addClass("active");
      countdownTimerEventVideo( event, eventTime );
    }

    function duringEventVideo( event, eventTime ) {
      event.find(".event-video__item").removeClass("active");
      event.find(".event-video__item--during").addClass("active");
    }

    function afterEventVideo( event, eventTime ) {
      event.find(".event-video__item").removeClass("active");
      event.find(".event-video__item--after").addClass("active");
    }

    function countdownTimerEventVideo( event, eventTime ) {
      var $timer       = event.find(".countdown--video");
      var $timerEndTime = eventTime;

      var timeEnd = moment($timerEndTime);

      $timer.countdown(timeEnd.toDate(), function(e) {
        if (e.elapsed) {
          checkEventVideoStatus( event, eventTime );
        } else {
          $timer.find(".days").text(e.strftime('%D'));
          $timer.find(".hours").text(e.strftime('%H'));
          $timer.find(".minutes").text(e.strftime('%M'));
          $timer.find(".seconds").text(e.strftime('%S'));
        }
      });
    }

    function wistiaVideo( event, eventTime ) {

      var $momentNow = moment();
      var $momentEvent = moment(eventTime);
      var diff = $momentNow.diff($momentEvent, 'seconds');
      var $wistiaVideo = event.find(".wistia_embed");

      if ($wistiaVideo.length) {
        var wistiaId = $wistiaVideo.attr("id").split("_")[1];

        window._wq = window._wq || [];

        _wq.push({
          id: wistiaId,
          onReady: function(video) {
            var videoDuration = video.duration();
            if (diff > videoDuration ) {
              afterEventVideo( event, eventTime );
            } else  {
              event.find(".event-video__item").removeClass("active");
              event.find(".event-video__item--join").addClass("active");
              $( ".event-video__autoplay" ).click(function() {
                var $momentNow = moment();
                var $momentEvent = moment(eventTime);
                var diff = $momentNow.diff($momentEvent, 'seconds');
                duringEventVideo( event, eventTime );
                video.time(diff);
                video.play();
                video.bind("end", function() {
                  afterEventVideo( event, eventTime );
                });
              });
            }
          }
        });
      } else {
        afterEventVideo( event, eventTime );
      }
    }

  }
})(jQuery);
(function() {

  if (isFramed()) return;

  var $html = $("html");
  var $body = $("body");
  var $exitPop = $(".exit-pop");
  var $closeX = $(".close-x");
  var $content = $exitPop.find(".modal__content");
  var timedReveal = $exitPop.data("timed-reveal") || 0;
  var cookieExpire = $exitPop.data("cookie-expire") || 10;
  var aggressive = !!Kajabi.theme.previewThemeId;
  var popHasBeenSeen = false;

  var bounce = ouibounce(document.getElementById("exit-pop"), {
    aggressive: aggressive,
    cookieExpire: cookieExpire,
    callback: function() {
      if (!popHasBeenSeen) {
        popHasBeenSeen = true;
        if ($exitPop.length > 0) {
          open();
        }
      }
    }
  });

  function open() {
    $exitPop.addClass("modal--open");
    $html.addClass("stop-scroll--html");
    $body.addClass("stop-scroll--body");
    $exitPop.on("click", close);
    $closeX.on("click", close);
    $content.on("click", function(event) {
      event.stopPropagation();
    });
  }

  function close() {
    $exitPop.removeClass("modal--open");
    $html.removeClass("stop-scroll--html");
    $body.removeClass("stop-scroll--body");
  }

  if (timedReveal > 0) {
    setTimeout(function() {
      if (!popHasBeenSeen) bounce.fire();
    }, timedReveal * 1000);
  }

})();

